import { useEffect, useState } from 'react';
import api from '../services/api';
import styles from './PlayersList.module.css';

type Player = {
  id: number;
  name: string;
  age: number;
  email?: string;
  phone?: string;
  country?: string;
  ranking: number;
  category: string;
  category_display: string;
  total_matches: number;
  wins: number;
  losses: number;
  win_rate: string;
  win_percentage: string;
  tournaments_played: number;
  best_finish?: string;
};

const PlayersList = () => {
  const [players, setPlayers] = useState<Player[]>([]);
  const [loading, setLoading] = useState(true);
  const [searchTerm, setSearchTerm] = useState('');
  const [categoryFilter, setCategoryFilter] = useState('');
  const [sortBy, setSortBy] = useState('ranking');

  useEffect(() => {
    fetchPlayers();
  }, [searchTerm, categoryFilter, sortBy]);

  const fetchPlayers = async () => {
    try {
      setLoading(true);
      const params = new URLSearchParams();
      if (searchTerm) params.append('search', searchTerm);
      if (categoryFilter) params.append('category', categoryFilter);

      const res = await api.get(`/players/?${params.toString()}`);
      let sortedPlayers = res.data;

      sortedPlayers.sort((a: Player, b: Player) => {
        if (sortBy === 'ranking') return b.ranking - a.ranking;
        if (sortBy === 'name') return a.name.localeCompare(b.name);
        if (sortBy === 'win_rate') return parseFloat(b.win_rate) - parseFloat(a.win_rate);
        return 0;
      });

      setPlayers(sortedPlayers);
    } catch (err) {
      console.error('Error fetching players:', err);
    } finally {
      setLoading(false);
    }
  };

  const getCategoryEmoji = (category: string) => {
    const emojis: { [key: string]: string } = {
      'MS': 'üë®',
      'WS': 'üë©',
      'MD': 'üë®‚Äçüë®',
      'WD': 'üë©‚Äçüë©',
      'XD': 'üë´'
    };
    return emojis[category] || 'üèì';
  };

  const getRankingBadge = (ranking: number) => {
    if (ranking >= 1000) return { color: 'var(--accent-gold)', text: 'ü•á Elite', gradient: 'linear-gradient(135deg, #fbbf24, #f59e0b)' };
    if (ranking >= 500) return { color: '#94a3b8', text: 'ü•à Advanced', gradient: 'linear-gradient(135deg, #cbd5e1, #94a3b8)' };
    if (ranking >= 100) return { color: '#fb923c', text: 'ü•â Intermediate', gradient: 'linear-gradient(135deg, #fb923c, #f97316)' };
    return { color: 'var(--accent-tertiary)', text: 'üå± Beginner', gradient: 'linear-gradient(135deg, #60a5fa, #3b82f6)' };
  };

  return (
    <div className="p-4 fade-in">
      <div className="card mb-4">
        <div className="card-header">
          <h2 className="mb-0 text-center">üèÜ Player Rankings & Stats</h2>
          <p className="text-center text-muted mb-0 mt-2">
            View and search all registered players
          </p>
        </div>

        <div className="card-body">
          {/* Filters */}
          <div className="grid grid-cols-3 mb-4">
            <div className="form-group">
              <label className="form-label">üîç Search Players</label>
              <input
                type="text"
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
                placeholder="Search by name, email, or country..."
                className="form-input"
              />
            </div>

            <div className="form-group">
              <label className="form-label">üèì Filter by Category</label>
              <select
                value={categoryFilter}
                onChange={(e) => setCategoryFilter(e.target.value)}
                className="form-select"
                aria-label="Filter players by category"
              >
                <option value="">All Categories</option>
                <option value="MS">Men Singles</option>
                <option value="WS">Women Singles</option>
                <option value="MD">Men Doubles</option>
                <option value="WD">Women Doubles</option>
                <option value="XD">Mixed Doubles</option>
              </select>
            </div>

            <div className="form-group">
              <label className="form-label">üìä Sort By</label>
              <select
                value={sortBy}
                onChange={(e) => setSortBy(e.target.value)}
                className="form-select"
                aria-label="Sort players"
              >
                <option value="ranking">Ranking Points</option>
                <option value="name">Name</option>
                <option value="win_rate">Win Rate</option>
              </select>
            </div>
          </div>

          {loading ? (
            <div className="loading">
              <div className="spinner"></div>
              <div>Loading players...</div>
            </div>
          ) : players.length === 0 ? (
            <div className="empty-state">
              <div className="empty-state-icon">üèì</div>
              <h3>No players found</h3>
              <p>No players match your search criteria.</p>
            </div>
          ) : (
            <div className="grid grid-auto-fit">
              {players.map((player, index) => {
                const badge = getRankingBadge(player.ranking);
                return (
                  <div 
                    key={player.id} 
                    className="card scale-in"
                    style={{ animationDelay: `${index * 0.05}s` }}
                  >
                    <div className="card-body">
                      <div className={styles.playerCard}>
                        <div style={{
                          fontSize: '2.5rem',
                          marginRight: '1rem',
                          background: badge.gradient,
                          borderRadius: '50%',
                          width: '60px',
                          height: '60px',
                          display: 'flex',
                          alignItems: 'center',
                          justifyContent: 'center',
                          boxShadow: 'var(--shadow-md)'
                        }}>
                          {getCategoryEmoji(player.category)}
                        </div>
                        <div className={styles.playerInfo}>
                          <h3 className={styles.playerName}>{player.name}</h3>
                          <span className={`badge ${styles.playerBadge}`} style={{ background: badge.gradient }}>{badge.text}</span>
                        </div>

                        <div className={styles.statsGrid}>
                          <div className={styles.statRow}>
                            <span className="text-muted">üèÜ Ranking:</span>
                            <span className={`text-primary ${styles.rankingPoints}`}>{player.ranking} pts</span>
                          </div>
                          <div className={styles.statRow}>
                            <span className="text-muted">üéØ Win Rate:</span>
                            <span className={`text-primary ${styles.rankingPoints}`}>{player.win_percentage}</span>
                          </div>
                          <div className={styles.statRow}>
                            <span className="text-muted">üìä Record:</span>
                            <span className={`text-primary ${styles.rankingPoints}`}>{player.wins}W - {player.losses}L</span>
                          </div>
                          <div className={styles.statRow}>
                            <span className="text-muted">üèì Category:</span>
                            <span className={`text-primary ${styles.rankingPoints}`}>{player.category_display}</span>
                          </div>
                          {player.country && (
                            <div className={styles.statRow}>
